import React from 'react';
import './App.css';
import docapp from '../src/components/docapp';
import Header from "";
import Footer from "";
import { Route, Switch } from "react-router";

function App() {
  return (
    <div className="App">
      <Header />
      <Route path="/" component={docapp} />
      <Footer />
    </div>
  );
}

export default App;
